import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import VendorInfoCard from './VendorInfoCard';
import VendorLogoCard from './VendorLogoCard';
import DispensaryInfoCard from './DispensaryInfoCard';
import DeactivateAccount from './DeactivateAccount';

const AccountPage = () => {
  return (
    <Container className="py-4">
      {/* Page Title */}
      <h2 className="text-center mb-4">Account</h2>

      {/* Top Row: VendorLogoCard and VendorInfoCard */}
      <Row className="g-4">
        <Col xs={12} md={6}>
          <VendorLogoCard />
        </Col>
        <Col xs={12} md={6}>
          <VendorInfoCard />
        </Col>
      </Row>

      {/* Bottom Row: DispensaryInfoCard and DeactivateAccount */}
      <Row className="g-4 mt-3">
        <Col xs={12}>
          <DispensaryInfoCard />
        </Col>
        <Col xs={12} className="d-flex justify-content-end">
          <DeactivateAccount />
        </Col>
      </Row>
    </Container>
  );
};

export default AccountPage;
